INSERT INTO `product` (`ID`, `categoryID`, `code`, `price`, `availability`, `description`, `isNew`, `isRecommended`, `status`, `medicalID`, `arrivalsID`) VALUES
(34, 13, 1839707, 3.95, 1, 'Описание: капсулы твердые желатиновые, номер 0, корпус белого цвета, крышечка - красного цвета.\r\n\r\nСостав: активное вещество: осельтамивир– 75 мг (в виде осельтамивира фосфата),\r\n\r\nвспомогательные вещества: повидон, лактоза безводная, кроскармеллоза натрия, тальк, магния стеарат, крахмал картофельный;\r\n\r\nсостав оболочки капсулы: желатин, титана диоксид (Е 171), краситель кармуазин (Е 122).\r\n\r\nФорма выпуска: капсулы.\r\n\r\nФармакотерапевтическая группа: Противовирусные средства для системного применения. Ингибиторы нейраминидазы.', 0, 0, 1, NULL, NULL),
(35, 13, 2343847, 3.05, 0, 'Состав: каждая таблетка содержит:\r\n\r\nактивное вещество: лозартан калия 50 мг;\r\n\r\nвспомогательные вещества: целлюлоза микрокристаллическая, кальция гидрофосфат дигидрат, кремния диоксид коллоидный безводный, кроскармеллоза натрия, тальк, магния стеарат;\r\n\r\nсостав оболочки: поливиниловый спирт, макрогол 3350, тальк, титана диоксид.\r\n\r\nОписание: таблетки круглые двояковыпуклые с риской, покрытые оболочкой белого цвета.\r\n\r\nФармакотерапевтическая группа: Средства, влияющие на ренин-ангиотензиновую систему. Антагонисты ангиотензина II.\r\n\r\nКод АТX: С09СА01\r\n\r\n \r\n\r\nФармакологические свойства\r\n\r\nЛозартан – антигипертензивное средство, являющееся синтетическим блокатором рецепторов ангиотензина II типа AT1 (БРА II). Снижает общее периферическое сопротивление сосудов (сопротивление сосудов току крови), сокращает постнагрузку (давление крови в аорте за счет снижения периферического сосудистого сопротивления току крови), снижает артериальное давление (АД). Снижает давление в малом (легочном) круге кровообращения, предупреждает задержку натрия и воды в организме. Повышает толерантность к физической нагрузке у пациентов с сердечной недостаточностью.\r\n\r\nПосле однократного приема гипотензивное действие достигает максимума через 6 часов и постепенно уменьшается в течение 24 часов. Стабильное понижение АД у большинства больных наблюдается к 3 – 6-й неделе курсового применения.\r\n\r\n ', 1, 1, 1, NULL, NULL),
(36, 13, 2028027, 2.7, 1, 'Описание: Капсулы твердые желатиновые номер 0 белого цвета. Содержимое капсул ─ смесь порошка и гранул белого или почти белого цвета, без запаха или со слабым специфическим запахом.\r\n\r\nФармакотерапевтическая группа: Средства для лечения заболеваний печени и желчевыводящих путей. Средства на основе желчных кислот. \r\n\r\nКод АТX: А05АА02 \r\n\r\nФармакологические свойства\r\n\r\nФармакодинамика\r\n\r\nНезначительное количество урсодеоксихолевой кислоты присутствует в желчи человека. После приема внутрь она снижает насыщенность желчи холестерином, подавляя его поглощение в кишечнике и снижая секрецию в желчь. Предположительно, благодаря дисперсии холестерина и образованию жидких кристаллов происходит постепенное растворение желчных камней.\r\n\r\nСогласно современным представлениям считают, что эффект урсодеоксихолевой кислоты при заболеваниях печени и холестазе обусловлен относительной заменой липофильных, токсичных желчных кислот гидрофильной цитопротекторной нетоксичной урсодеоксихолевой кислотой, улучшением секреторной способности гепатоцитов и иммунорегуляторных процессов.', 0, 1, 1, NULL, NULL),
(37, 13, 2019487, 3.25, 1, 'Состав: активное вещество: иматиниб – 100 мг (в виде иматиниба мезилата),\r\n\r\nвспомогательные вещества: кросповидон, кремния диоксид коллоидный безводный, целлюлоза микрокристаллическая, магния стеарат,\r\n\r\nсостав оболочки капсулы: титана диоксид (Е 171), желатин.\r\n\r\nФорма выпуска: капсулы 100 мг.\r\n\r\nФармакотерапевтическая группа: Прочие противоопухолевые препараты, ингибиторы протеинкиназ.\r\n\r\nКод АТХ: L01ХE01.\r\n\r\nФармакологические свойства\r\n\r\nПротивоопухолевое средство, ингибитор тирозинкиназы. Иматиниб эффективно ингибирует фермент Bcr-Abl-тирозинкиназу на клеточном уровне. Иматиниб селективно подавляет пролиферацию и вызывает апоптоз клеточных линий, позитивных по Bcr-Abl, а также незрелых лейкозных клеток при хроническом миелолейкозе с положительной филадельфийской хромосомой (Ph+) и при остром лимфобластном лейкозе. Иматиниб селективно ингибирует Bcr-Abl-позитивные колонии, полученные из клеток крови у больных хроническим миелолейкозом.\r\n\r\nКроме того, иматиниб является сильнодействующим ингибитором рецепторов тирозинкиназы для фактора роста тромбоцитов (PDGF) и фактора стволовых клеток (SCF), c-Kit, а также подавляет клеточные реакции, опосредуемые вышеназванными факторами. In vitro иматиниб ингибирует пролиферацию и индуцирует апоптоз клеток стромальных опухолей желудочно-кишечного тракта, экспрессирующих Kit-мутации.', 0, 1, 1, NULL, NULL),
(38, 13, 1953212, 2.75, 1, 'Состав: одна таблетка содержит:\r\n\r\nактивное вещество: кандесартана цилексетила 8 мг, 16 мг или 32 мг;\r\n\r\nвспомогательные вещества: лактоза моногидрат, крахмал кукурузный, гидроксипропилцеллюлоза, кроскармеллоза натрия, макрогол 8000, магния стеарат.\r\n\r\nОписание:\r\n\r\nКандесартан-НАН 8 мг: таблетки белого цвета круглые, плоские с одной стороны и выпуклые с другой стороны с риской и фаской на плоской стороне.\r\n\r\nКандесартан-НАН 16 мг: круглые двояковыпуклые таблетки белого цвета.\r\n\r\nКандесартан-НАН 32 мг: круглые двояковыпуклые таблетки белого цвета.\r\n\r\nФармакотерапевтическая группа: Антагонисты ангиотензина II. Кандесартан.\r\n\r\nКод АТX: C09CA06\r\n\r\nФармакологические свойства\r\n\r\nКандесартан является селективным блокатором рецепторов ангиотензина II (БРА II). Кандесартан не ингибирует ангиотензинпревращающий фермент (АПФ), который осуществляет превращение ангиотензина I в ангиотензин II и разрушает брадикинин; не влияет на АПФ и не приводит к накоплению брадикинина или субстанции Р. При сравнении кандесартана с ингибиторами АПФ развитие кашля реже встречалось у пациентов, получавших кандесартана цилексетил. Кандесартан не связывается с рецепторами других гормонов и не блокирует ионные каналы, участвующие в регуляции функций сердечно-сосудистой системы. В результате блокирования AT1 рецепторов ангиотензина II происходит дозозависимое повышение уровня ренина, ангиотензина I, ангиотензина II и снижение концентрации альдостерона в плазме крови.\r\n\r\nПри артериальной гипертензии кандесартан в', 0, 0, 1, NULL, NULL),
(39, 13, 1602042, 3.7, 0, 'Состав: 1 таблетка содержит: действующего вещества – циннаризина –   25 мг; вспомогательные вещества: лактоза моногидрат, картофельный крахмал, повидон, кремния диоксид коллоидный безводный, магния стеарат.\r\n\r\nФорма выпуска: таблетки, 25 мг.\r\n\r\nФармакотерапевтическая группа: препараты, применяемые для лечения головокружения.\r\n\r\nКод АТХ: N07CA02.\r\n\r\nПоказания к применению\r\n\r\n- Поддерживающая терапия при симптомах лабиринтных расстройств, которые включают обморок, шум в ушах, нистагм, тошноту и рвоту.\r\n\r\n- Профилактика болезни движения.\r\n\r\n -Профилактика мигрени.\r\n\r\n- Поддерживающая терапия при симптомах цереброваскулярного происхождения, которые включают обморок, шум в ушах, головную боль сосудистого происхождения, раздражительность, потерю памяти и неспособность сосредоточится.\r\n\r\n- Поддерживающая терапия при симптомах периферических сосудистых расстройств, которые включают болезнь Рейно, акроцианоз, перемежающуюся хромоту, трофические нарушения, трофические и варикозные язвы, парестезию, ночные спазмы конечностей, холодные конечности.\r\n\r\nПрименение при беременности и в период грудного вскармливания.', 0, 0, 1, NULL, NULL),
(40, 13, 2028367, 4.3, 1, 'Состав: 1 таблетка содержит:\r\n\r\nдействующее вещество – пентоксифиллин –100 мг;\r\n\r\nвспомогательные вещества: лактоза моногидрат, крахмал картофельный, кислота стеариновая, акрил-из (в том числе сополимер метакриловой кислоты с этилакрилатом, тальк, триэтилцитрат, натрия лаурилсульфат, натрия карбонат, кремния диоксид коллоидный безводный, титана диоксид E 171).\r\n\r\nОписание: Таблетки, покрытые кишечнорастворимой оболочкой, белого цвета, с двояковыпуклой поверхностью.\r\n\r\nКод АТХ С04АD03.\r\n\r\nФармакотерапевтическая группа: периферический вазодилататор.\r\n\r\nФармакологическое действие\r\nПентоксифиллин  улучшает реологические свойства крови (текучесть) и снижает ее вязкость.  Оказывает антитромботическое действие. Уменьшает общее периферическое сопротивление и расширяет коронарные сосуды. Лечение  приводит к улучшению симптоматики нарушений мозгового кровообращения. Благоприятные терапевтические результаты отмечены в случае применения пентоксифиллина при сосудистой патологии глаз и внутреннего уха.\r\n\r\nУлучшает микроциркуляцию в зонах нарушенного кровоснабжения. При \"перемежающейся\" хромоте приводит к удлинению дистанции ходьбы, устранению ночных судорог икроножных мышц и болей в покое. Оказывает благоприятный эффект при трофических нарушениях тканей (в т.ч. при трофических язвах).\r\n\r\nПоказания к применению\r\n- Нарушения периферического кровообращения атеросклеротического и диабетического генеза (например, перемежающаяся хромота, диабетическая ангиопатия).\r\n\r\n- Трофические нарушения (например, трофические язвы голеней, гангрена).\r\n\r\n- Симптоматическое лечение при церебральных ишемических заболеваниях (за исключением болезни Альцгеймера и других видов деменции).', 0, 1, 1, NULL, NULL),
(41, 14, 1129365, 7.8, 1, 'Состав: одна таблетка содержит:\r\n\r\nактивное вещество: гликлазид 60 мг;\r\n\r\nвспомогательные вещества: лактозы моногидрат, мальтодекстрин, гипромеллоза, магния стеарат, кремния диоксид коллоидный безводный.\r\n\r\nОписание: белые продолговатые таблетки с линией деления и знаком «DIA 60», выдавленным на обеих сторонах.\r\n\r\nФармакотерапевтическая группа: Пероральные гипогликемические средства, исключая инсулины. Сульфонамиды, производные сульфонилмочевины.\r\n\r\nКод АТX: A10BB09\r\n\r\nФармакологические свойства\r\n\r\nФармакодинамика\r\n\r\nГликлазид – это пероральный противодиабетический гипогликемический препарат, который отличается от аналогичных соединений наличием N-содержащего гетероциклического кольца с эндоциклической связью.\r\n\r\nГликлазид снижает уровень глюкозы в крови, стимулируя секрецию инсулина бета-клетками островков Лангерганса. После 2 лет лечения сохраняется повышение уровня постпрандиального инсулина и секреция С-пептида.\r\n\r\nПомимо метаболических свойств, гликлазид обладает гемоваскулярной активностью.\r\n\r\nВлияние на секрецию инсулина\r\n\r\nПри диабете 2 типа, гликлазид восстанавливет первый пик секреции инсулина в ответ на поступление глюкозы и усиливает вторую фазу секреции инсулина. Значительное повышение секреции инсулина отмечается в ответ на стимуляцию, обусловленную введением глюкозы или приемом пищи.', 1, 1, 1, NULL, NULL),
(42, 14, 1128670, 6.4, 1, 'Состав: каждая таблетка содержит:\r\n\r\nактивное вещество: валсартан – 80 мг или 160 мг;\r\n\r\nвспомогательные вещества: целлюлоза микрокристаллическая, крахмал кукурузный прежелатинизированный, кроскармеллоза натрия, повидон, кремния диоксид коллоидный безводный, магния стеарат, лактоза моногидрат;\r\n\r\nсостав оболочки: гидроксипропилметилцеллюлоза, титана диоксид (Е171), коповидон, полидекстроза, полиэтиленгликоль, среднецепочечные триглицериды, оксид железа красный (Е172).\r\n\r\nОписание: таблетки круглые двояковыпуклые с риской, покрытые оболочкой розового цвета.\r\n\r\n \r\n\r\nФармакотерапевтическая группа: Средства, влияющие на ренин-ангиотензиновую систему. Антагонисты ангиотензина II.\r\n\r\n \r\n\r\nКод АТX: С09СА03\r\n\r\nФармакологические свойства\r\n\r\nВалсартан оказывает гипотензивное действие. Специфический блокатор AT1 рецепторов ангиотензина II (БРА II), при его приеме маловероятно развитие сухого кашля. При лечении артериальной гипертензии валсартан снижает артериальное давление (АД), не влияя на частоту сердечных сокращений (ЧСС).\r\n\r\nАнтигипертензивный эффект развивается через 2 часа после приема внутрь, достигает максимума в течение 4-6 часов и сохраняется более 24 часов. После регулярного приема максимальное снижение АД достигается через 2-4 недели.\r\n\r\nПрименение препарата приводит к уменьшению случаев госпитализации по поводу сердечной недостаточности, замедлению прогрессирования сердечной недостаточности, улучшению функционального класса по классификации NYHA, увеличению фракции выброса, а также к уменьшению признаков и симптомов сердечной недостаточности и улучшению качества жизни по сравнению с плацебо.', 0, 0, 1, NULL, NULL),
(43, 14, 683364, 2.1, 1, 'Комбинированный иммуностимулирующий препарат бактериального происхождения для сублингвального (подъязычного) приема. Представляет собой поливалентный антигенный комплекс, включающий лизаты бактерий — наиболее часто встречающихся возбудителей респираторных инфекций. Лизаты, входящие в состав препарата Исмиген®, получены путем механического разрушения бактериальных клеток.\r\n\r\nПрепарат Исмиген® оказывает неспецифическое иммуностимулирующее и специфическое вакцинирующее действие на различные звенья иммунитета. Стимулирует как местный (повышает концентрацию секреторного IgA), так и системный (клеточный и гуморальный) иммунитет. Активирует фагоцитоз, увеличивает содержание лизоцима в слюне, способствует увеличению количества иммунокомпетентных клеток, повышает концентрацию сывороточных IgA, IgG, IgM и уменьшает концентрацию сывороточного IgE. Повышает функциональную активность макрофагов (в т.ч. альвеолярных) и полиморфноядерных лейкоцитов, что способствует уничтожению инфекционных агентов.\r\n\r\nВ результате лечения препаратом Исмиген® сокращается частота, выраженность и длительность острых инфекций респираторного тракта; наблюдается облегчение и нивелирование таких симптомов, как лихорадка, кашель, одышка, уменьшается потребность в антибактериальной и противовоспалительной терапии; у пациентов с хроническими заболеваниями респираторного тракта препарат также предупреждает обострения.', 0, 0, 1, NULL, NULL),
(44, 15, 355025, 1.75, 1, 'Селективный бета1-адреноблокатор без собственной симпатомиметической активности; оказывает антигипертензивное, антиаритмическое и антиангинальное действие. Блокируя в невысоких дозах бета1-адренорецепторы сердца, уменьшает стимулированное катехоламинами образование циклического аденозинмонофосфата (цАМФ) из аденозинтрифосфата (АТФ), снижает внутриклеточный ток ионов кальция (Са2+), оказывает отрицательное хроно-, дромо-, батмо- и инотропное действие (урежает частоту сердечных сокращений, угнетает проводимость и возбудимость, снижает сократимость миокарда).\r\nПри увеличении дозы оказывает бета2-адреноблокирующее действие.\r\nОбщее периферическое сосудистое сопротивление в начале применения бета-адреноблокаторов, в первые 24 ч, увеличивается (в результате реципрокного возрастания активности альфа-адренорецепторов и устранения стимуляции бета2-адренорецепторов), которое через 1-3 сут возвращается к исходному, а при длительном назначении снижается.\r\nАнтигипертензивный эффект связан с уменьшением минутного объема крови, симпатической стимуляции периферических сосудов, снижением активности ренин-ангиотензин-альдостероновой системы (имеет большее значение для пациентов с исходной гиперсекрецией ренина), восстановлением чувствительности барорецепторов дуги аорты (не происходит усиления их активности в ответ на снижение артериального давления (АД)) и влиянием на центральную нервную систему. При артериальной гипертензии эффект наступает через 2-5 дней, стабильное действие - через 1-2 мес.\r\nАнтиангинальный эффект обусловлен уменьшением потребности миокарда в кислороде в результате урежения частоты сердечных сокращений и снижения сократимости, удлинением диастолы, улучшением перфузии миокарда. За счет повышения конечного диастолического давления в левом желудочке и увеличения растяжения мышечных волокон желудочков может повышать потребность миокарда в кислороде, особенно у пациентов с хронической сердечной недостаточностью (ХСН).', 0, 0, 1, NULL, NULL),
(45, 16, 1563832, 1.32, 1, 'Основным механизмом действия Кагоцела® является способность индуцировать продукцию интерферонов. Кагоцел® вызывает образование в организме человека так называемых поздних интерферонов, являющихся смесью α- и β-интерферонов, обладающих высокой противовирусной активностью. Кагоцел® вызывает продукцию интерферонов практически во всех популяциях клеток, принимающих участие в противовирусном ответе организма: Т- и В- лимфоцитах, макрофагах, гранулоцитах, фибробластах, эндотелиальных клетках. При приеме внутрь одной дозы Кагоцела® титр интерферонов в сыворотке крови достигает максимальных значений через 48 часов. Интерфероновый ответ организма на введение Кагоцела® характеризуется продолжительной (до 4-5 суток) циркуляцией интерферонов в кровотоке. Динамика накопления интерферонов в кишечнике при приеме внутрь Кагоцела® не совпадает с динамикой титров циркулирующих интерферонов. В сыворотке крови продукция интерферонов достигает высоких значений лишь через 48 часов после приема Кагоцела®, в то время как в кишечнике максимум продукции интерферонов отмечается уже через 4 часа. \r\nКагоцел®, при назначении в терапевтических дозах, нетоксичен, не накапливается в организме. Препарат не обладает мутагенными и тератогенными свойствами, не канцерогенен и не обладает эмбриотоксическим действием. \r\nНаибольшая эффективность при лечении Кагоцелом® достигается при его назначении не позднее 4-го дня от начала острой инфекции. В профилактических целях препарат может применяться в любые сроки, в том числе и непосредственно после контакта с возбудителем инфекции.', 0, 0, 1, NULL, NULL);
